import { Link } from "react-router-dom";
import homeLogo from '../logo.svh'


class NavBar extends Component {
  render() {
    return (
     <nav classname="navbar navbar-expand-sm navbar-dark px-sm-5">
        <Link to='/'>

        </Link>
     </nav>
    );
  }
}
export default NavBar;
